				null
			);
		}
		set
		{
			t.intVec = value;
			composer.composeAddress(address, (UInt64)Address.intVec);
			composer.composeSimpleVector("value", Publishable.makeComposer(value), false);
			composer.composeAddressEnd();
		}
	}
