	{
		composer.composeStructBegin();
		publishable_seven_publisher.compose(composer, this.t);
		composer.composeStructEnd();
	}
	public void startTick(BufferT buff)
	{
		composer.startTick(buff);
		composer.composeStateUpdateMessageBegin();
	}
